import React from "react";
import "./Footer.css";
import githubPath from "../../images/github_icon.svg";
import facebookPath from "../../images/facebook_icon.svg";

export default function Footer() {
  return (
    <section className="footer">
      <div className="footer__container">
        <p className="footer__copyright">
          ©️ 2023 Supersite Powered by News API
        </p>
        <div className="footer__socials">
          <a className="footer__link" href="#practicum">
            Home
          </a>
          <a className="footer__link" href="#practicum">
            Practicum
          </a>

          <a href="#practicum">
            <img className="footer__icon" src={githubPath} alt="github"></img>
          </a>
          <a href="#practicum">
            <img
              className="footer__icon"
              src={facebookPath}
              alt="facebook"
            ></img>
          </a>
        </div>
      </div>
    </section>
  );
}
